import React from 'react';
import '../styles/Contact.css';
import { Helmet } from 'react-helmet';

class Contact extends React.Component {
  render() {
    return (
      <div className="contact-container">
        <Helmet>
          <title>Contact Us | Techbitz.io - We're Here to Help</title>
          <meta name="description" content="Get in touch with Techbitz.io for any queries related to web design, digital marketing, SEO, and more. We're here to guide you to online success." />
        </Helmet>
        <div className="heading">
          <h2>Let's Connect</h2>
        </div>
        <div className="content">
          <p>We're eager to hear from you. Whether you have questions about our services or need assistance with your digital strategy, our team at Techbitz.io is ready to assist. Contact us today and let's drive your business to new heights.</p>
        </div>
      </div>
    );
  }
}

export default Contact;
